DROP TABLE IF EXISTS `acc_invoice`;
CREATE TABLE `acc_invoice` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `number` char(255) DEFAULT NULL COMMENT '账单编号',
  `dates` datetime DEFAULT NULL COMMENT '账单日期',
  `payment_term` varchar(255) DEFAULT NULL COMMENT '付款方式',
  `customer_po_no` varchar(255) DEFAULT NULL COMMENT '客户订单编号',
  `customer_account` varchar(255) DEFAULT NULL COMMENT '客户编号',
  `salesperson` varchar(255) DEFAULT NULL COMMENT '销售',
  `sales_order_no` varchar(255) DEFAULT NULL COMMENT '客户订货订单编号',
  `sales_order_date` datetime DEFAULT NULL COMMENT '送货日期',
  `ship_via` varchar(255) DEFAULT NULL COMMENT '运输方式',
  `invoice_company` varchar(255) DEFAULT NULL COMMENT '发票公司',
  `invoice_address` varchar(255) DEFAULT NULL COMMENT '发票地址',
  `invoice_tel` varchar(255) DEFAULT NULL COMMENT '联系电话',
  `disc` varchar(255) DEFAULT NULL COMMENT '税率',
  `sub_total` varchar(255) DEFAULT NULL COMMENT '小计',
  `gst` varchar(255) DEFAULT NULL COMMENT '税',
  `total_amount` varchar(255) DEFAULT NULL COMMENT '合计',
  `city` varchar(11) DEFAULT NULL,
  `generated_by` varchar(255) DEFAULT NULL COMMENT '生成账单人员',
  `lcu` varchar(11) DEFAULT NULL,
  `luu` varchar(11) DEFAULT NULL,
  PRIMARY KEY (`id`)
